import React, { Component } from 'react';
import logo from './image/logo.svg';
import './css/App.css';
import './css/bootstrap.min.css';

class Login extends Component {
  render() {
    return (
      <div className="Login">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <div className="body">
          <h3>Please Sign in</h3>
            <form id="loginform">
                <div className="form-group">
                    <input className="form-control" placeholder="User Name"/>
                </div>
                <div className="input-group">
                    <input className="form-control login-password" type="password" className="form-control" placeholder="Password" />
                </div>
                <div className="button-group">
                    <input className="btn btn-lg btn-success btn-block" id="chk"  value="Login" />
                </div>
                </form>
                <button className="btn btn-sm btn-default collapse" type="button">Sign Up</button>
            <hr />
        </div>
          <a
            className="App-link"
            href="https://reactjs.org"
            target="_blank"
            rel="noopener noreferrer"
          >
            Registration
          </a>
        </header>
      </div>
    );
  }
}

export default Login;
